import React, {useState} from 'react'
import Sidebar from '../../Components/Sidebar/Sidebar';
import './Profile.css'

const Profile = ({ta}) => {
    return (
        <>
            <Sidebar setTab={tab} />
            <div className="home-section">
                <div>{tab}</div>
                Hello
            </div>
        </>
    )
}

export default Profile;
